INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 1, 1, 0, 160, 0, 1, 122601, 110, 0.029, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1.5, 101, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (111, 2, 0, 0, 120, 1, 2, 122401, 105, 0.014, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 2.5, 102, 3);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 3, 0, 1, 350, 0, 3, 122501, 110, 0.017, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 2.5, 103, 2);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 4, 0, 0, 130, 1, 4, 107501, 110, 0.016, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 1.5, 104, 3);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 5, 1, 0, 160, 0, 5, 107601, 110, 0.014, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 2.5, 105, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (103, 6, 0, 1, 255, 0, 6, 107801, 120, 0.029, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 3.5, 106, 2);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (103, 7, 1, 0, 160, 0, 7, 110601, 120, 0.013, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 3.5, 107, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (103, 8, 0, 1, 350, 0, 8, 110401, 110, 0.014, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 2.5, 108, 2);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (100, 9, 0, 0, 130, 1, 9, 110501, 105, 0.012, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 1.5, 109, 3);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (103, 10, 1, 0, 200, 0, 10, 115701, 105, 0.014, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 2.5, 110, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (103, 11, 0, 1, 350, 0, 11, 113601, 105, 0.071, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 2.5, 111, 2);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (103, 12, 0, 0, 130, 1, 12, 107901, 120, 0.014, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 1.5, 112, 3);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 13, 1, 0, 200, 0, 13, 108001, 110, 0.022, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 1.5, 113, 2);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (108, 14, 1, 0, 160, 0, 14, 110301, 110, 0.031, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 2.5, 114, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 15, 0, 0, 130, 1, 15, 107701, 110, 0.036, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0.5, 115, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (95, 16, 0, 1, 350, 0, 16, 113101, 110, 0.048, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 3.5, 116, 2);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 17, 0, 0, 130, 1, 17, 113301, 105, 0.043, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 1.5, 117, 3);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (95, 18, 0, 0, 130, 1, 18, 113201, 105, 0.018, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 1.5, 118, 2);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (108, 19, 1, 0, 160, 0, 19, 117001, 110, 0.021, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 2.5, 119, 2);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 20, 0, 1, 255, 0, 20, 113501, 110, 0.036, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 2.5, 120, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 21, 0, 1, 350, 0, 21, 113401, 105, 0.02, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 2.5, 121, 3);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 22, 0, 0, 130, 1, 22, 110101, 110, 0.018, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 2.5, 122, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (111, 23, 1, 0, 160, 0, 23, 110001, 105, 0.03, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 3.5, 123, 3);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (103, 24, 0, 0, 130, 1, 24, 117201, 110, 0.027, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1.5, 124, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (108, 25, 1, 0, 160, 0, 25, 117301, 105, 0.02, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 3.5, 125, 2);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 26, 0, 1, 350, 0, 26, 117401, 110, 0.04, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 2.5, 126, 3);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 27, 0, 1, 350, 0, 27, 117101, 110, 0.009, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 3.5, 127, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 28, 0, 1, 255, 0, 28, 122901, 120, 0.022, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 3.5, 128, 1);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (105, 29, 0, 0, 130, 1, 29, 122801, 110, 0.028, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 2.5, 129, 3);
INSERT INTO `v1_acf7fca8d2b752ed44055de2c20e8503152a8b7ceb0d4edb675ed314134c43c5` VALUES (108, 30, 1, 0, 130, 0, 30, 122701, 105, 0.023, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 3.5, 130, 2);
